import React, { Component } from 'react'
import './TeamHeading.css'

export class TeamHeading extends Component {
    render() {
        return (
            <div id='teamHeading'>
                <h1>Meet the team!</h1>
                <p>We are 14 students across different majors and years at the University of Toronto. 
                    Compiled of both technical and creative people, 
                    we make up the Developer Student Club (DSC) UTSG Chapter </p>
            </div>


        )
    }
}

export default TeamHeading
